        ENGINEERING NOTICE
         -  -  -  -  -  -  -  -  -  -  -  -  -
        As the AME alone cannot power the station forever, you are now tasked with finishing this RTG-based power setup lovingly dubbed the "suppermatter engine".


        To prevent agonizing death, put on a radiation suit and set up geiger counters in suitable locations.


        Your first task is to fill all existing radiation collectors with plasma tanks from the dispenser above. This is essential for power production and they must be refueled with fresh plasma occasionally. Turn them all on once they are fueled.


        Once that is done, the exposed plutonium core will produce power. Make sure to close the radiation shutters afterwards!


        If you have followed this notice to plan and refuel the collectors regularly, the station should be powered indefinitely.
